'GetStartedSettings'=>'Post Affiliate Pro on suunniteltu siten että se voi toimia oletusasetuksilla. <br/> Kuitenkin, on suositeltavaa säätää asetukset vastaamaan kunkin käyttäjän omia tarpeita. <br/> Löydät asetukset ruudun <strong> Asetukset & työkalut -> Asetukset <strong/>. <br/><br/> Yksityiskohtaiset tiedot kaikista mahdollisista asetuksista löydät käyttäjän oppaasta tai tietokannasta.  ',
'Define your commissions'=>'Määrittele komissiosi',
'GetStartedCommissions'=>'Ohejelma luo automaattisesti yhden oletuskampanjan asennuksen yhteydessä. Voit muokata sitä tai luoda omia kamppanjoita.<br/><br/>
Kampanjoita käytetään luomaan tuoteryhmiä (yksi tai useampi tuote) joilla on samat myynti komissiot asetukset.<br/><br/>
Esimerkiksi, sinulla on kampanja tuotteelle1, jossa affiliateille maksetaan komissio per klikkaus, ja toinen kampanja tuotteelle2 jossa komissiot perustuvat myynteihin.<br/><br/>
Tai sinulla voi Halvat tuotteet niminen kampanja, jossa komissio on 40% myyntihinnasta ja toinen kampajan nimeltään Kalliit tuotteet joissa komissio on vain 15% myyntihinnasta.<br/><br/><a href=\'http://www.qualityunit.com/postaffiliatepro/services/integration/\' target=\'_blank\'>Tarvitsetko apua komissio rakenteen suunnittelussa?</a>',
'Add banners and other creatives'=>'Lisää bannereita tai muita mainoksia',
'GetStartedCreatives'=>' <strong>Bannerien hallinnassa</strong> voit luoda hallita mainoksia, linkkejä, tavallisia bannereita, HTML bannereita, FLASH tai promo sähköposti bannereita.<br/>
Jokaiselle bannerille tulee määrittää oma URL - vierailija siirtyy tämän URL:n mukaiselle sivulle klikkauksen jälkeen.<br/><br/><a href=\'http://www.qualityunit.com/postaffiliatepro/services/webdesign/\' target=\'_blank\'>Tarvitsetko apua bannereiden kehittämisessä?</a>',
'Set up emails'=>'Aseta sähköpostit',
'GetStartedEmails'=>'Sinun tulisi määritellä sähköpostit eri toimintojen mukaan. Tämä sisältää: <ul><li><strong>mail account</strong> - miten sähköpostit lähetetään. Voit valita joko viesti() funktion tai  SMTP palvelimen.</li><li><strong>email templates</strong> - näitä malleja käytetään kun järjestelmä lähettää automaattisesti sähköpostin, kuten uuden käyttäjän rekisteröinti tai myynti ilmoitus</li><li><strong>email notifications</strong> - voit määritellä minkälaisia viestejä haluat vastaanottaa kauppiaana ja mitkä viestit ovat affiliatejen käytössä.</li></ul>Varmista että sähköpostitili on määritelty oikein - lähetä kokeilu viestejä. Ilman toimivaa sähköpostia affiliatet ei saa viestejä rekisteröinneistä tms. ',
'Customize your affiliate signup form'=>'Suunnittele oma rekisteröintilomakkeesi',
'GetStartedSignupForm'=>'Tarkista oletu lomake ja muokkaa se tarpeidesi mukaiseksi.<br/><br/>
