'Customize affiliate panel'=>'Muokkaa affiliate paneelia',
'GetStartedAffPanel'=>'Affiliate paneeli on todella joustava Post Affiliate Pro:ssa.<br/> Voit muokata lähes kaikkia valikkoja, muokata ja luoda omia sisältöjä niihin tai laittaa linkkejä muille sivuille.<br/><br/><a href=\'http://www.qualityunit.com/postaffiliatepro/services/webdesign/\' target=\'_blank\'>Tarvitsetko apua valikkojen suunnittelussa?</a>',
'GetStartedIntegrate'=>'Integrointi on mentelmä jonka avulla yhdistät affiliatet-järjestelmän sivuillesi, ostoskori tai maksuyhdyskäytävä yhdistetään siten, että affiliate järjestelmää huomautetaan lähteistä ja ostoista.<br/>
Ilmoituksen saapuessa järjestelmään, affiliate ohjelma rekisteröi myynnin, löytää myyntiÄ koskeava affiliaten ja luo komission tälle affiliatelle.<br/><br/>
Integrointi tarkoittaa useissa tapauksissa muutamien koodien lisäämistä sivuillesi, ja tämä opastetaan askel askeleelta integraatio oppaassa tavallisimmille ostoskoreille ja maksujärjestelmille. <br/><br/><a href=\'http://www.qualityunit.com/postaffiliatepro/services/integration/\' target=\'_blank\'>Tarvitsetko apua ohjelmien integroinnissa?</a>',
'Test everything'=>'Testaa kaikki',
'GetStartedTest'=>'"Kun  olet määrittänyt kampanjoita,  määritellyt oikea palkkiot,  ja luoneet bannerit /  linkit, kannattaa testata  järjestelmää. <br/>
Paras tapa on simuloida koko prosessi affiliate ja katsantokannasta:
<ol>
<li> Rekisteröidy Facebookiin jotkut testaus affiliate - hyväksymisen jälkeen sinun pitäisi saada vahvistus sähköpostitse salasanan, ja sinun pitäisi pystyä kirjautumaan sisään affiliate paneeliin </ li>
<li> Kirjaudu affiliate paneelin saada koodi bannerit / linkit ja laittaa teema päälle testaus-sivulla </ li>
<li> Klikkaa banneria ja tarkista, että sitten on rekisteröity </ li>
<li> jälkeen klikkaa, yrittää tehdä testin myynti ja tarkista, että myynti komissio on rekisteröity affiliate järjestelmä (vain myynti-tai per johtaa palkkiot) </ li>
</ ol>

Jos koet jotain ongelmia näiden vaiheiden, päälle <strong> Debug tapahtumaloki </ strong> ja katso <strong> vianmääritys </ strong> "
</ol>
